import React, { useEffect, useState } from "react";

const Appointments = () => {
  const [appointments, setAppointments] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch("http://localhost:5001/api/appointments")
      .then((res) => res.json())
      .then((data) => {
        setAppointments(data);
        setLoading(false);
      })
      .catch(() => setLoading(false));
  }, []);

  const nextAppointment = appointments[0];

  return (
    <div className="min-h-screen bg-slate-100 p-4 md:p-8">
      {/* Header */}
      <header className="mb-6">
        <h1 className="text-3xl font-bold text-gray-800">My Appointments üè•</h1>
        <p className="text-gray-600 mt-1">
          Here you can see your hospital visits and what to expect.
        </p>
      </header>

      {/* Content grid */}
      <section className="grid grid-cols-1 lg:grid-cols-3 gap-6">
        {/* Main column */}
        <div className="lg:col-span-2 space-y-6">
          {/* Next appointment */}
          <div className="bg-white rounded-2xl p-6 shadow">
            <h2 className="text-xl font-semibold text-gray-800 mb-4">
              Next Appointment
            </h2>

            {loading ? (
              <p className="text-gray-400">Loading...</p>
            ) : nextAppointment ? (
              <div className="space-y-2">
                <p className="text-2xl font-bold text-[#015CE9]">
                  {nextAppointment.title}
                </p>
                <p className="text-gray-700">
                  üìÖ {nextAppointment.appointment_date}
                </p>
                <p className="text-gray-700">
                  ‚è∞ {nextAppointment.appointment_time}
                </p>
                <p className="text-gray-700">
                  üë©‚Äç‚öïÔ∏è {nextAppointment.doctor_name}
                </p>
                <p className="text-gray-700">üìç {nextAppointment.location}</p>
              </div>
            ) : (
              <p className="text-gray-400">
                You don‚Äôt have any upcoming appointments.
              </p>
            )}
          </div>

          {/* Upcoming appointments list */}
          <div className="bg-white rounded-2xl p-6 shadow">
            <h2 className="text-xl font-semibold text-gray-800 mb-4">
              Upcoming Visits
            </h2>

            {appointments.length > 0 ? (
              <ul className="space-y-4">
                {appointments.map((appt) => (
                  <li
                    key={appt.id}
                    className="border rounded-xl p-4 flex flex-col sm:flex-row sm:justify-between sm:items-center"
                  >
                    <div>
                      <p className="font-semibold">{appt.title}</p>
                      <p className="text-sm text-gray-500">
                        {appt.appointment_date} ¬∑ {appt.appointment_time}
                      </p>
                      <p className="text-sm text-gray-500">
                        {appt.doctor_name} ¬∑ {appt.location}
                      </p>
                    </div>

                    <span className="mt-2 sm:mt-0 text-sm px-3 py-1 rounded-full bg-blue-100 text-blue-700">
                      {appt.status}
                    </span>
                  </li>
                ))}
              </ul>
            ) : (
              <p className="text-gray-400">No appointments scheduled yet.</p>
            )}
          </div>
        </div>

        {/* Info column */}
        <aside className="space-y-6">
          {/* What will happen */}
          <div className="bg-white rounded-2xl p-6 shadow">
            <h3 className="text-lg font-semibold mb-2">What will happen? üòä</h3>
            <p className="text-gray-600 text-sm">
              A friendly doctor or nurse will explain everything first. You can
              ask questions anytime, and your hospital buddy will be with you!
            </p>
          </div>

          {/* How to prepare */}
          <div className="bg-white rounded-2xl p-6 shadow">
            <h3 className="text-lg font-semibold mb-2">How to prepare üéí</h3>
            <ul className="text-gray-600 text-sm list-disc list-inside space-y-1">
              <li>Bring your hospital card</li>
              <li>Arrive 10 minutes early</li>
              <li>Wear comfortable clothes</li>
            </ul>
          </div>

          {/* Getting there */}
          <div className="bg-white rounded-2xl p-6 shadow">
            <h3 className="text-lg font-semibold mb-2">How to get there üó∫Ô∏è</h3>
            <p className="text-gray-600 text-sm">
              You can walk, take a bus, or be dropped off by car. Follow the
              hospital signs to your department.
            </p>
          </div>
        </aside>
      </section>
    </div>
  );
};

export default Appointments;
